  let m1 = rc1 * sy;
  let m2 = rc2 * sz;

  let row0 = vec3<f32>(m0.x, m1.x, m2.x);
  let row1 = vec3<f32>(m0.y, m1.y, m2.y);
  let row2 = vec3<f32>(m0.z, m1.z, m2.z);

  let s00 = dot(row0,row0); let s01 = dot(row0,row1); let s02 = dot(row0,row2);
